import React from "react";

function GameAlt() {
  const btn = document.querySelector(".js-button") as HTMLButtonElement;
  btn.addEventListener("click", (e) => {
    e.preventDefault();
    btn.classList.add("is-active");
    btn.classList.toggle("is-toggled");
    btn.blur();
    setTimeout(() => btn.classList.remove("is-active"), 400);
  });

  return (
    <button className="Button js-button">
      <i className="Button-icon Button-icon--toggled fa fa-heart"></i>
      <i className="Button-icon Button-icon fa fa-heart-o"></i>
    </button>
  );
}

export default GameAlt;
